Наш Авто-центр предлагает вам:
*Охранные комплексы (обычная и спутниковая сигнализация, замок капота и т.д.);
*Дополнительное оборудование: (парктроники, аудио и видео оборудование, свеклоподъёмники и т.д.);
*обширный ассортимент запаснычх частей;
* услуги по ремонту автомобиля;
* установку охранных комплексов и доп. оборудования;
* и многое другое.

При покупке товара в нашем магазине вы получаете 10% скидку на установку приобретённого товара.
